import React from "react";
import "./Showcase.scss";

export default (props) => (
  <div className="showcaseBox">
    <div class="card">
  <div class="card-img-caption">
    <p class="card-text font1">Title</p>
    <img class="card-img-top" src={props.imgLink} alt="Card image cap"></img>
  </div>
    
  <div class="card-body">
    <div class="card-text titleShowcase font7">Test</div>
  </div>
</div>
    </div>
);
